export const insertAt = <T>(
  array: T[],
  items: T | T[],
  /**
   *
   */
  beforeIndex: number
): T[] => {
  const itemsArray = Array.isArray(items) ? items : [items];

  // NB: slice makes copies
  const before = array.slice(0, beforeIndex);
  const after = array.slice(beforeIndex);
  return [...before, ...itemsArray, ...after];
};

export const removeIndexFromArray = <T>(array: T[], index: number) => {
  const before = array.slice(0, index);
  const after = array.slice(index + 1);
  return [...before, ...after];
};

export const findLastIndex = <T>(array: T[], findFn: (item: T) => boolean) => {
  const lastIndex = array
    .map((item, index) => ({ item, index }))
    .filter(({ item }) => findFn(item))
    .pop()?.index;

  return lastIndex;
};

export const putIndexAtIndex = <T>(
  array: T[],
  index: number,
  toIndex: number
) => {
  const item = array[index];
  const arrayWithoutIndex = removeIndexFromArray(array, index);
  const changedArray = insertAt(arrayWithoutIndex, item, toIndex);
  return changedArray;
};

export const byteCount = (s: string) => {
  return encodeURI(s).split(/%..|./).length - 1;
};

export type MappedObject<T> = {
  [mapKey: string]: T;
};

export const createMappedObject = <T extends { [key: string]: any }, U = T>(
  array: T[],
  /**
   Key to make the map from. Must be unique or it could be overwritten. Key must be a string
   */
  mapKey: keyof T,
  /**
   * If the result of the mapped object, based on the object should have mapped values, provide this mapfunction to get them.
   */
  mapFn?: (value: T, array: T[]) => U,
): MappedObject<U> => {
  const mappedObject = mergeObjectsArray(
    array.map((item) => {
      const key: string = item[mapKey];
      const value = mapFn ? mapFn(item, array) : (item as unknown as U);

      return {
        [key]: value,
      };
    }),
  );

  return mappedObject;
};

export const createMappedKeysObject = <T,>(
  keys: string[],
  map: (key: string) => T,
) => {
  const result = mergeObjectsArray(keys.map((key) => ({ [key]: map(key) })));

  return result;
};

export const createPromisedMappedKeysObject = async <T,>(
  keys: string[],
  map: (key: string) => Promise<T>,
) => {
  const result = mergeObjectsArray(
    await Promise.all(keys.map(async (key) => ({ [key]: await map(key) }))),
  );

  return result;
};

