const pipelinifyOne = async <T,>(
  input: any,
  functions: ((...parameters: any[]) => any)[],
  context?: { [key: string]: any },
  config?: { showErrors?: boolean },
) => {
  let errors: { functionName: string; inputValue: any }[] = [];

  const finalOutput = await functions.reduce(
    async (inputPromise, fn) => {
      const rawInputs = makeArray(await inputPromise);
      const inputs = rawInputs.filter(notEmpty);
      if (inputs.length === 0) {
        // should never happen
        return;
      }

      const rawOutput = await Promise.all(
        inputs.map((input) => fn(input, context)),
      );

      if (config?.showErrors) {
        const errorInputValues = rawOutput
          .map((output, index) => (!output ? inputs[index] : undefined))
          .filter(notEmpty);

        //console.log({ errorInputValues });
        errors = errors.concat(
          errorInputValues.map((inputValue) => ({
            functionName: fn.name,
            inputValue,
          })),
        );
      }

      const output = rawOutput.filter(notEmpty).flat();

      return output;
    },
    promisifyValue(input) as Promise<any>,
  );

  return { output: finalOutput as T | T[], errors };
};

export const pipelinify = async <T extends unknown>(
  input: any,
  functions: ((...parameters: any[]) => any)[],
  context?: { [key: string]: any },
  config?: {
    showErrors?: boolean;
  },
) => {
  if (!input) {
    return;
  }
  const inputs = makeArray(input);

  const result = await Promise.all(
    inputs.map((input) => pipelinifyOne<T>(input, functions, context, config)),
  );

  const output = result.map((x) => x.output).flat() as T[];
  const errors = result.map((x) => x.errors).flat();
  return { output, errors };
};

