export const runFunctionWithTimeout = async <
  TPromisedFnReturnType,
  TFn extends () => any = () => any
>(
  fn: TFn,
  timeoutMs: number,
  onFinish?: (result: TPromisedFnReturnType, isTimedOut: boolean) => void
): Promise<{ isTimedOut: boolean; result?: TPromisedFnReturnType }> => {
  const result = await new Promise<{
    isTimedOut: boolean;
    result?: TPromisedFnReturnType;
    // NB: resolve does NOT stop the promise! Everything will be executed.
  }>(async (resolve, reject) => {
    let isTimedOut = false;
    const timeout = setTimeout(() => {
      isTimedOut = true;

      clearTimeout(timeout);
      resolve({ isTimedOut: true });
      // the function should return now, however, the execution should still continue
    }, timeoutMs);

    const fnResult = (await fn()) as TPromisedFnReturnType;

    if (onFinish) {
      // something to do only if the function is timed out...
      onFinish(fnResult, isTimedOut);
    }

    clearTimeout(timeout);
    resolve({ result: fnResult, isTimedOut: false });
  });

  return result;
};

export const simplifyOpenapi = (openapi: OpenapiDocument) => {
  const pathsArray = objectMapToArray<OpenapiPathItemObject, "path">(
    //@ts-ignore
    openapi.paths || {},
    "path",
  );

  // The method must be done in the map of the array of the first, then putting the path back on and do a flat. Harder
  const pathArrayWithMethods = pathsArray
    .map(({ path, description, summary, $ref, ...methodObject }) => {
      const result = objectMapToArray(
        methodObject as {
          [method in HttpMethods]?: OpenapiOperationObject;
        },
        "method",
      );

      return result.map((x) => ({
        path,
        description,
        summary,
        $ref,
        ...x,
      }));
    })
    .flat();

  // In this one I'm doing multiple simplifications at once, and it seems hard to generalise but it's doing the same as above
  const simplified = pathArrayWithMethods.map(
    ({ requestBody, responses, ...item }) => {
      //NB: we're loosing potentially some information here! But if the convention is that we don't have these, its ok.

      const forcedRequestBody = requestBody as
        | OpenapiRequestBodyObject
        | undefined;
      const forcedResponses = responses?.["200"] as
        | OpenapiResponseObject
        | undefined;

      //However, the golden egg would be to do this without information loss and bi-directionally, automatically flattening a nested monster, so I can use it as an ActionSchema

      // I think this must be possible if we just list the locations of the objectmaps that nestify things
      const newItem = {
        ...item,

        // Response stuff
        responsesStatusCode: 200,
        responseDescription: forcedResponses?.description,
        responseMediaType: "application/json",
        responseContentSchema:
          forcedResponses?.content?.["application/json"]?.schema,

        // Body stuff
        requestBodyRequired: forcedRequestBody?.required,
        requestBodyDescription: forcedRequestBody?.description,
        requestBodySchema:
          forcedRequestBody?.content?.["application/json"]?.schema,
      };

      return newItem;
    },
  );

  return simplified;
};

export const splitObject = <TObject extends O>(
  object: TObject,
  secondObjectKeys: string[],
): [Partial<TObject>, Partial<TObject>] => {
  const initialValue = [object, {}] as [Partial<TObject>, Partial<TObject>];

  const newObject = secondObjectKeys.reduce((previous, key) => {
    const [primary, secondary] = previous;

    const newPrimary = {
      ...primary,
      [key]: undefined,
    };

    delete newPrimary[key];

    const newSecondary = {
      ...secondary,
      [key]: primary[key],
    };

    return [newPrimary, newSecondary] as [Partial<TObject>, Partial<TObject>];
  }, initialValue);

  return newObject;
};

export const trimSlashes = (absoluteOrRelativePath: string) => {
  const isFirstCharacterSlash = absoluteOrRelativePath.charAt(0) === "/";
  const isLastCharacterSlash =
    absoluteOrRelativePath.charAt(absoluteOrRelativePath.length - 1) === "/";

  const withoutSlashPrefix = isFirstCharacterSlash
    ? absoluteOrRelativePath.slice(1)
    : absoluteOrRelativePath;
  const withoutSlashSuffix = isLastCharacterSlash
    ? withoutSlashPrefix.slice(0, withoutSlashPrefix.length - 1)
    : withoutSlashPrefix;

  return withoutSlashSuffix;
};

